import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

const OrderSummary = () => {
  return (
    <div className="w-96 h-fit z-100 bg-white shadow-lg p-2">
		  <div className="flex flex-col justify-center px-4">
			<p className='text-dark-gray font-bold text-lg'>Order Summary</p>
			<div className='w-full rounded mt-4 flex flex-col p-2 items-center justify-around '>
                <div className='w-full h-6 bg-light-gray rounded-lg'>
                    <span>Order Amount</span>
                    <span>300.000</span>
                </div>
				<div className='w-full h-4 bg-light-gray rounded-lg'>
                    <span>Delivery Fee</span>
                    <span>300.000</span>
                </div>
                <div className='w-full h-4 bg-light-gray rounded-lg'>
                    <span>Discount</span>
                    <span>300.000</span>
                </div>
			</div>
		  </div>
		</div>
  );
};

export default OrderSummary;
